  return (
    <div className="app">
      Our cool lectionary site
      <div>
      <Buttons/>
      </div>
      {/* Dark theme is passed as class */}
      <div className={darkTheme}>
        <Buttons/>
      </div>
    </div>
  );
}

export default App;
